import React from "react";
import "../App.css";
import "../css/Skills.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBootstrap } from "@fortawesome/free-brands-svg-icons";

const skillsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Skills() {
  const skillsStyle = skillsStyles();

  return (
    <div id="skills">
      <div>
        <p className="menu-name">SKILLS</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>
            <FontAwesomeIcon icon={faBootstrap} className="icon-size" />
          </Paper>
        </Grid>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>
            <FontAwesomeIcon icon={faBootstrap} className="icon-size" />
          </Paper>
        </Grid>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>협력</Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Skills;
